hlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2977555","type":"CustomJS"},{"attributes":{"axis_label":"Volume","coordinates":null,"formatter":{"id":"2977422"},"group":null,"major_label_policy":{"id":"2977617"},"minor_tick_line_color":null,"ticker":{"id":"2977394"}},"id":"2977393","type":"LinearAxis"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"2977398","type":"WheelZoomTool"},{"attributes":{"coordinates":null,"group":null},"id":"2977614","type":"Title"},{"attributes":{"line_alpha":{"value":0.1},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"2977440","type":"Segment"},{"attributes":{"line_alpha":0.2,"line_color":"#1f77b4","line_width":1.5,"x":{"field":"index"},"y":{"field":"equity"}},"id":"2977226","type":"Line"},{"attributes":{},"id":"2977275","type":"Selection"},{"attributes":{"children":[{"id":"2977626"},{"id":"2977628"}],"sizing_mode":"stretch_width"},"id":"2977629","type":"Row"},{"attributes":{"format":"0.[00]%"},"id":"2977379","type":"NumeralTickFormatter"},{"attributes":{},"id":"2977459","type":"BasicTickFormatter"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPx1S5sjFNu8/tm0G2eVE7z9cKrWuf33tP7/Hrp05Pu4/js/wFuuj7T/BThoqi4ntP1Ip0smGmOw/nZccgwal6z9bDoOO2R/rP+0wwhufB+s/JV/KrUK76j+dodOBGbTqPzV/iBeIkeo/gjkA7Y7m6T+7WyfWMxnqP23YspQe0ek/T7KbqMwV6j9XK/G4XMjpP0SgIas5Cuo/aTCfAfSx6j8QSpjXvGvqP6hyMlVWsek/pAVqE9ne6T9FQSTGoezpP+GyMT6qq+o/ecszuC8c6z+XhR4EsIfpP+xRayL7Nek/+YNdaoYI6T8tCBlLx+roP/WrPYulEek/vfUefFqd6D+9BVp8sRDpP4nHE+kI5ek/lN274ZFM6T/ImoA6OOzoP1mqQmuUQeg/gfHJRsQN6T/lxJvGSMfnP44b0qQsheg/+nfPCbIR6D/CY7G
